    geo_json_9b831f0c55b74196f05472856958846a.bindTooltip(
      function (layer) {
        let div = L.DomUtil.create("div");

        let handleObject = (feature) => (typeof feature == "object" ? JSON.stringify(feature) : feature);
        let fields = ["id", "bus1_id", "bus2_id", "parameters_id"];
        let aliases = ["Id:", "Bus1:", "Bus2:", "Parameters:"];
        let table =
          "<table>" +
          String(
            fields
              .map(
                (v, i) =>
                  `<tr>
            <th>${aliases[i].toLocaleString()}</th>

            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`,
              )
              .join(""),
          ) +
          "</table>";
        div.innerHTML = table;

        return div;
      },
      { className: "foliumtooltip", maxWidth: 800, sticky: false },
    );
